class Solution:
    def longestPalindrome(self, s: str) -> str:
        chars = [k for k in s]
        for i in range(len(chars)-1): 
            for j in range(i, len(chars)): 
                if (chars[i] == chars[j]): 
                    print(chars[i:j+1])
    def isPalindrome(self, s: str) -> bool: 
        chars = [k for k in s]
        for i in range(len(chars)): 
            if (chars[i] != chars[-1-i]): 
                return False
        return True
    
print(Solution().longestPalindrome(""))
